import { Injectable } from '@angular/core';
import { Observable, of } from 'rxjs';

@Injectable({
  providedIn: 'root'
})
export class DataService {

  constructor() { }

  getHomeData() {
    const myObservable = new Observable(observer => {
      setTimeout(() => {
        observer.next({
          title: "Fruits & Vegetables",
          img: "assets/fruits-vegetables.png"
        });
        observer.complete();
      }, 2000);
    });
    return myObservable;
  }

  getFruitsData() {
    const myObservable = new Observable(observer => {
      setTimeout(() => {
        observer.next([
          {id: 1, name: "Apple", pic: "data:image/jpeg;base64,"},
          {id: 2, name: "Orange", pic: "data:image/jpeg;base64,"},
          {id: 3, name: "Mango", pic: "data:image/jpeg;base64,"},
          {id: 4, name: "Grape", pic: "data:image/jpeg;base64,"},
          {id: 5, name: "Banana", pic: "data:image/jpeg;base64,"}
        ]);
        observer.complete();
      }, 2000);
    });
    return myObservable;
  }

  getVegetablesData() {
    const myObservable = new Observable(observer => {
      setTimeout(() => {
        observer.next([
          {id: 1, name: "Onion", pic: "data:image/jpeg;base64,"},
          {id: 2, name: "Tomato", pic: "data:image/jpeg;base64,"},
          {id: 3, name: "Potato", pic: "data:image/jpeg;base64,"},
          {id: 4, name: "Capsicum", pic: "data:image/jpeg;base64,"},
          {id: 5, name: "Broccoli", pic: "data:image/jpeg;base64,"}
        ]);
        observer.complete();
      }, 2000);
    });
    return myObservable;
  }
}
